    id INT PRIMARY KEY,
    symbol VARCHAR(50),
    analysis_result VARCHAR(255),
    timestamp TIMESTAMP
);

CREATE TABLE MarketDataFeed (
    id SERIAL PRIMARY KEY,
    symbol VARCHAR(255) NOT NULL,
    price DECIMAL NOT NULL,
    timestamp TIMESTAMP NOT NULL
);

